const nonDestructiveAssign=(a={},b={})=>{const c=Object.entries(b),d=c.length;for(let e=0;e<d;e++){const [f,g]=c[e],h=a[f],i=h===undefined;if(typeof g!=="object"){if(i)a[f]=g}else{if(Array.isArray(g)===true){const j=g.length;if(i)a[f]=[];if(Array.isArray(h)===false)a[f]=[h];for(let k=0;k<j;k++){const l=g[k];if(h.includes(l)===false)a[f].push(l)}}else if(i&&g===null){a[f]=null}else{a[f]=nonDestructiveAssign(a[f],g)}}}return a}
